import notifications from "../utils/notifications.js";
import Notification from "./Notification.jsx";

function NotificationList () {
    return (
        <div>
            <div>
                {notifications.map((e) =>  {
                <Notification 
                        picture={e.picture} name={e.name}  />}
                     )}
            </div>
        </div>
    ) 
}

export default NotificationList;
